import React from 'react';
import '../styles/Series.css';

export default function BCSCard(props) {
    console.log()
    return (
        <div id="info">
            <div id="temporada">
                <h2> Temporada { props.value } </h2>
            </div>
            {props.CPS.keys().map((value, id) => {
                return (<h4>  Episodio { props.CPS[value]['title'] } </h4>)
            })}
        </div>
    );
}
